(8, 1, NULL, NULL, NULL, 1, '10 BÍ KÍP HỌC TẬP ĐỘT PHÁ CÙNG CHUYÊN GIA', NULL, NULL, '9TxAupC4pC4CSsYcsyoJGyfedSN-s5Vkn7rZr-L8HPbF4Hg1fnMujLEX56g3ie5s.jpg', 'TDfbIGbZPhPFjCsV9oFjGMwga8QauAEahIUxOTyWPTadwvo_RdO9-UEjzzo7sDXS.pdf', NULL, '<p>ffwhfow</p>\r\n<p>bkjbiw</p>\r\n<p>fbijwkn</p>', '<p>10 B&Iacute; K&Iacute;P HỌC TẬP TỪ CHUY&Ecirc;N GIA.</p>\r\n<p>Ch&uacute;ng t&ocirc;i đang ho&agrave;n thiện bộ s&aacute;ch thực tế, ph&ugrave; hợp v&agrave; tốt nhất d&agrave;nh cho học vi&ecirc;n của m&igrave;nh.&nbsp;</p>\r\n<p>Trong qu&aacute; tr&igrave;nh chờ đợi, ch&uacute;ng t&ocirc;i gửi tặng phi&ecirc;n bản demo.</p>\r\n<p>Ch&uacute;ng t&ocirc;i sẽ cung cấp những bộ s&aacute;ch hay nhất v&agrave; thực tế với xu thế hiện nay để phục vụ bạn.</p>', 49, 100, 2, 15, 0),
(9, 1, NULL, NULL, NULL, 1, '10 KỸ THUẬT GÂY ẤN TƯỢNG BAN ĐẦU ', NULL, NULL, 'MM7Rz_z_HgrofhUMmFLCpdiSWn1EWkNk3WXCSm_suZVs1SWlO4_E2CY90Shnm8O0.jpg', 'pP5NwDbPK_UoWn2XKxSdts2_y8i7hrKJX6g7hKdGPwyvx9eI-jEgHtOV71nYD_be.pdf', NULL, '<p>10 KỸ THUẬT G&Acirc;Y ẤN TƯỢNG TRONG 10S GIAO TIẾP ĐẦU TI&Ecirc;N.</p>\r\n<p>Bạn sẽ kh&oacute; c&oacute; cơ hội lần thứ 2 để l&agrave;m việc n&agrave;y, đ&oacute; l&agrave; g&acirc;y ấn tượng với người kh&aacute;c. Cuốn s&aacute;ch n&agrave;y sẽ gi&amp;u', '<p>10 KỸ THUẬT G&Acirc;Y ẤN TƯỢNG BAN ĐẦU.</p>\r\n<p>Bạn kh&oacute; c&oacute; cơ hội thứ hai để l&agrave;m điều n&agrave;y, l&agrave; g&acirc;y thiện cảm, ấn tượng đối với đối phương.</p>\r\n<p>Cuốn s&aacute;ch ph&aacute;t h&agrave;nh trong th&aacute;ng tới sẽ gi&uacute;p bạn ho&agrave;n to&agrave;n điều n&agrave;y.</p>\r\n<p>Ch&uacute;ng t&ocirc;i đang trong qu&aacute; tr&igrave;nh ho&agrave;n thiện v&agrave; sẽ ra mắt sớm nhất.</p>\r\n<p>BẠN C&Oacute; THỂ TẢI PHI&Ecirc;N BẢN DEMO ĐỂ ĐỌC TRƯỚC.</p>\r\n<p>Hẹn gặp lại bạn với những bộ s&aacute;ch thực tế của 24H SCHOOL</p>', 49, 100, 1, 20, 0);
