INSERT INTO `course` (`id`, `name`, `slug`, `image`, `video`, `describe`, `introduce`, `price`, `sale`, `joined`, `id_lecturer`, `id_class`, `id_subject`, `id_topic`, `audience`, `benefits`, `allow`, `rating`) VALUES
(1, 'Tự chủ tuổi 18 để đột phá', 'hanh-trinh-tu-chu-tuoi-18-online', 'swbJ2_nsrFceHiQxDzjbPHn7G1TG0OCWjRyGqAmPHjaGcvaud66D4pHFbPRboIBq.jpg', 'https://youtu.be/W9hK69t3SiE', '<p style=\"text-align: justify;\"><strong>TỰ CHỦ TUỔI 18</strong></p>\r\n<p style=\"text-align: justify;\">Ch&uacute;ng ta đang c&oacute; những cản trở trong qu&aacute; tr&igrave;nh ph&aacute;t triển bản th&acirc;n m&igrave;nh. Việc ba mẹ, thầy c&ocirc; chưa thực sự tin tưởng ch&uacute;ng ta, v&agrave; mọi quyết định đều phải th&ocirc;ng qua những người lớn. Trong khi ch&uacute;ng ta đang sống trong một m&ocirc;i trưởng trẻ, năng động như vậy, liệu việc tự chủ trong c&aacute;c quyết định c&oacute; quan trọng?</p>\r\n<p style=\"text-align: justify;\">Ch&uacute;ng ta muốn thi v&agrave;o trường A những ba mẹ lại bảo v&agrave;o B. Bạn chưa biết c&aacute;ch để thuyết phục họ? Bạn cũng kh&ocirc;ng đủ dũng cảm để n&oacute;i l&ecirc;n tiếng n&oacute;i của m&igrave;nh?</p>\r\n<p style=\"text-align: justify;\">Bạn l&agrave; một người nh&uacute;t nh&aacute;t, nhưng c&oacute; một khao kh&aacute;t mạnh mẽ sẽ ph&aacute;t triển v&agrave; c&oacute; thể tự quyết định cuộc sống của m&igrave;nh. Điều g&igrave; quan trọng hơn khi được sống với đam m&ecirc;?</p>\r\n<p style=\"text-align: justify;\">Bạn sẽ được học những c&aacute;ch thức, để trở th&agrave;nh 1 người trưởng th&agrave;nh, tự chủ trước tuổi 18 trong chương tr&igrave;nh n&agrave;y.</p>', NULL, 299000, NULL, 301, 1, 11, 8, 5, NULL, NULL, 1, NULL),
(2, 'Chinh phục mục tiêu học tập nhẹ nhàng hơn', 'hanh-trinh-tu-chu-tuoi-18-online-cap-do-2', '7ygBzVvJ07OouQjH72v9Di6a-WnYRIGbN5IziyjihEbI7c5r-79xDxbIE6sncftV.jpg', '', '<p style=\"text-align: justify;\"><strong>CHINH PHỤC MỤC TI&Ecirc;U HỌC TẬP NHẸ NH&Agrave;NG HƠN</strong></p>\r\n<p style=\"text-align: justify;\">C&oacute; một sự thật l&agrave; nếu bạn l&agrave;m việc g&igrave; đ&oacute; m&agrave; c&agrave;ng cố gắng để l&agrave;m bạn sẽ c&agrave;ng mất động lực. Đ&atilde; bao lần bạn cố gắng để học nhưng rồi chỉ k&eacute;o d&agrave;i được 30 ph&uacute;t hay 1 tiếng l&agrave; c&ugrave;ng? Khi cố gắng, ch&uacute;ng ta đang tự đưa m&igrave;nh v&agrave;o cảm gi&aacute;c PHẢI L&Agrave;M thứ g&igrave; đ&oacute; v&agrave; cố để l&agrave;m n&oacute;, tức l&agrave; ch&uacute;ng ta kh&ocirc;ng muốn l&agrave;m n&oacute; đứng kh&ocirc;ng?</p>\r\n<p style=\"text-align: justify;\">Đạt được mục ti&ecirc;u m&agrave; vất vả, thức đ&ecirc;m, mắt cận, sức khỏe ảnh hướng m&agrave; gọi l&agrave; th&agrave;nh c&ocirc;ng ư? Vậy như thế n&agrave;o mới gọi l&agrave; đạt mục tiệu 1 c&aacute;ch b&igrave;nh y&ecirc;n đ&acirc;y?</p>\r\n<p style=\"text-align: justify;\">Bạn sẽ được học những c&aacute;ch thức để ch&iacute;nh phục mục ti&ecirc;u trong cuộc sống. D&ugrave;ng đ&ograve;n bẩy g&igrave; v&agrave; l&agrave;m như thế n&agrave;o. Tại sao c&ugrave;ng học một lớp, c&ugrave;ng độ tuổi v&agrave; c&ugrave;ng một kiến thức thầy c&ocirc; giảng, tại sao bạn lại học k&eacute;m hơn người bạn trong lớp. V&agrave; tại sao c&ugrave;ng 1 nguy&ecirc;n liệu v&agrave; c&ocirc;ng thức, tại sao mỗi người lại nấu ra một m&oacute;n ăn kh&aacute;c nhau ngon hơn?</p>\r\n<p style=\"text-align: justify;\">Đ&oacute; l&agrave; những b&iacute; mật t&ocirc;i sẽ chia sẻ với bạn trong chương tr&igrave;nh n&agrave;y.</p>', NULL, 299000, NULL, 54, 1, 11, 8, 5, NULL, NULL, 1, NULL),
(15, 'Bí mật từ ngu tới tóp 1 môn toán', 'bi-mat-tu-ngu-toi-top-1-mon-toan-cua-lop-thay-tmt', 'gLnTlCooB9E-Jpyu1GGYwO-GWereopUXjT--lXleR_DucFvOQ3p4Q-n44evarq34.jpg', '', '<p style=\"text-align: justify;\"><strong>B&Iacute; MẬT TỪ NGU TỚI TỚP 1 M&Ocirc;N TO&Aacute;N</strong></p>\r\n<p style=\"text-align: justify;\">T&ocirc;i từng l&agrave; một học sinh học dốt nhất lớp. Ch&aacute;n học, bỏ học v&agrave; lười l&agrave;m b&agrave;i tập về nh&agrave; ch&iacute;nh l&agrave; những yếu tố quan trọng khiến t&ocirc;i c&oacute; th&agrave;nh t&iacute;ch học tập tệ như thế.</p>\r\n<p style=\"text-align: justify;\">C&oacute; một b&iacute; mật khiến t&ocirc;i đột ph&aacute; trong học tập chỉ trong đ&uacute;ng 1 th&aacute;ng &aacute;p dụng theo phương ph&aacute;p đ&oacute;. Mọi thay đổi đ&atilde; đến, đứng đầu lớp chọn 2 của trường về m&ocirc;n to&aacute;n, thi đậu v&agrave;o trường đại học m&igrave;nh mong muốn v&agrave; c&ograve;n biết c&aacute;ch để học tốt c&aacute;c m&ocirc;n học kh&aacute;c nhờ tu&acirc;n thủ theo c&aacute;c quy tắc n&agrave;y.</p>\r\n<p style=\"text-align: justify;\">Bạn sẽ học được những c&ocirc;ng thức để trở n&ecirc;n giỏi m&ocirc;n to&aacute;n, mặc kề tr&igrave;nh độ v&agrave; kiến thức của bạn đang thế n&agrave;o. Bạn sẽ thay đổi được t&igrave;nh h&igrave;nh của m&igrave;nh với chương tr&igrave;nh đ&agrave;o tạo v&ocirc; c&ugrave;ng đặc biệt n&agrave;y.</p>', NULL, 199000, NULL, 30, 1, 11, 1, 6, NULL, NULL, 1, NULL),
(17, 'Thuyết âm mưu học giỏi bất chấp môn toán', 'thuyet-am-muu-hoc-gioi-bat-chap-cap-do-1', '1481125969.jpg', '', '<p style=\"text-align: justify;\"><strong>THUYẾT &Acirc;M MƯU HỌC GIỎI BẤT CHẤP M&Ocirc;N TO&Aacute;N</strong></p>\r\n<p style=\"text-align: justify;\">Bao gồm 10 bộ thuyết &acirc;m mưu được đ&uacute;c kết gi&uacute;p bạn đạt th&agrave;nh t&iacute;ch cao trong học tập bộ m&ocirc;n to&aacute;n học. Những bộ thuyết &acirc;m mưu n&agrave;y l&agrave; sản phẩm video của cuốn s&aacute;ch rất được đ&ocirc;ng đảo học sinh y&ecirc;u th&iacute;ch 18+ THUYẾT &Acirc;M MƯU HỌC GIỎI BẤT CHẤP của t&aacute;c giả TMT.</p>\r\n<p style=\"text-align: justify;\">Sau khi kết th&uacute;c kh&oacute;a học, bạn sẽ nhận được c&ocirc;ng cụ hỗ trợ gi&uacute;p học tập m&ocirc;n to&aacute;n. Phương ph&aacute;p học tập to&aacute;n ho&agrave;n to&agrave;n mới nhất hiện nay. Những b&iacute; k&iacute;p n&agrave;y ph&ugrave; hợp với học sinh Việt Nam, v&agrave; bạn sẽ đạt được kết quả đột ph&aacute; với bộ m&ocirc;n to&aacute;n.</p>\r\n<p>&nbsp;</p>', NULL, 299000, NULL, 30, 1, 11, 1, 1, NULL, NULL, 1, NULL),
(19, 'Đột phá tư duy hướng nghiệp', 'buoc-dau-tim-kiem-nganh-nghe-phu-hop-cho-tuong-lai', 'ERH9yY7XqxLZf9DpRFdDa09UHCyEcGOWL6kNa_Kn3K5dVhGf2Ay1HEkl87ijzmJy.jpg', 'https://drive.google.com/file/d/0B5zTbwy4Yi3BSFRhQWJVUUpPR1E/view?usp=sharing', '<p style=\"text-align: justify;\"><strong>ĐỘT PH&Aacute; TƯ DUY HƯỚNG NGHIỆP.</strong></p>\r\n<p style=\"text-align: justify;\">L&agrave; chương tr&igrave;nh đ&agrave;o tọa huấn luyện gi&uacute;p học vi&ecirc;n định nghĩa đ&uacute;ng đắn hơn về hướng nghiệp. C&aacute;c m&ocirc; h&igrave;nh hướng nghiệp b&agrave;i bản v&agrave; c&oacute; hiệu quả gi&uacute;p x&aacute;c định được ngh&agrave;nh nghề ph&ugrave; hợp trong tương lai.</p>\r\n<p style=\"text-align: justify;\">Kh&oacute;a học ph&ugrave; hợp với học sinh c&aacute;c khối lớp 8 đến 12 v&agrave; c&aacute;c gi&aacute;o vi&ecirc;n muốn tham khảo về kiến thức hướng nghiệp.</p>', NULL, 199000, NULL, 240, 1, 11, 8, 4, NULL, NULL, 1, NULL),
(20, 'Đột phá hướng nghiệp tìm nghề chọn nghành thành công', 'dinh-huong-nghe-nghiep-bai-ban-tuong-lai-ruc-sang', 'RlXvySrcv-jqmSBZbjIBfw8VAKEuxhi-NDxGsAW-BXdbtKfgLnVRdVIs4J7akppK.jpg', '', '<p style=\"text-align: justify;\"><strong>ĐỘT PH&Aacute; HƯỚNG NGHIỆP T&Igrave;M NGHỀ CHỌN NGH&Agrave;NH TH&Agrave;NH C&Ocirc;NG.</strong></p>\r\n<p style=\"text-align: justify;\">Chọn nghề l&agrave; việc v&ocirc; c&ugrave;ng quan trọng. Bạn kh&ocirc;ng biết bắt đầu từ đ&acirc;u v&agrave; l&agrave;m như thế n&agrave;o để t&igrave;m ra sở trường của m&igrave;nh. T&igrave;m nghề ph&ugrave; hợp với t&iacute;nh c&aacute;ch v&agrave; năng lực của bạn th&acirc;n cũng như nhu cầu của x&atilde; hội.</p>\r\n<p style=\"text-align: justify;\">Bạn gặp kh&oacute; khăn trong việc t&igrave;m kiếm nguồn kiến thức hướng nghiệp. C&aacute;c b&agrave;i tập về hướng nghiệp v&agrave; những nguồn lực để an t&acirc;m kiếm cho m&igrave;nh điều cần biết về mọi ng&oacute;c ng&aacute;ch trong hướng nghiệp.</p>\r\n<p style=\"text-align: justify;\">Tất cả những trăn trở n&agrave;y sẽ được giải đ&aacute;p từ đ&acirc;y, từ chương tr&igrave;nh đ&agrave;o tạo n&agrave;y.</p>', NULL, 350000, NULL, 90, 1, 11, 8, 4, NULL, NULL, 1, NULL),
(34, 'HỌC TẬP ĐỘT PHÁ LẦN 1', 'hoc-tap-dot-pha-lan-1', 'AEI8nIuKm113AcHMMEWJP7htHm1VnOx6b-vlBh_EYKZuBW6TK1B4pV3VapuaZkmC.jpg', '', '<p style=\"text-align: justify;\"><strong>HỌC TẬP ĐỘT PH&Aacute;.</strong></p>\r\n<p style=\"text-align: justify;\"><strong>Để tham gia miễn ph&iacute; chương tr&igrave;nh, đề nghị học vi&ecirc;n li&ecirc;n hệ chuy&ecirc;n gia TMT qua facebook c&aacute; nh&acirc;n&nbsp;( v&agrave;o mục giảng vi&ecirc;n để t&igrave;m th&ecirc;m th&ocirc;ng tin li&ecirc;n hệ) để nhận m&atilde; giảm gi&aacute; 100% học ph&iacute;.</strong></p>\r\n<p style=\"text-align: justify;\">L&agrave; chương tr&igrave;nh huấn luyện do chuy&ecirc;n gia huấn luyện tạo đột ph&aacute; trong học tập gửi tới học vi&ecirc;n trong h&agrave;ng th&aacute;ng. Kh&oacute;a huấn luyện ho&agrave;n to&agrave;n miễn ph&iacute; v&agrave; mỗi th&aacute;ng tổ chức một lần cho gần 100 học vi&ecirc;n.</p>\r\n<p style=\"text-align: justify;\"><strong>Học vi&ecirc;n tham gia sẽ trải qua 1 th&aacute;ng huấn luyện chủ yếu về.</strong></p>\r\n<ol style=\"text-align: justify;\">\r\n<li>Tạo lập th&oacute;i quen cuộc sống bản th&acirc;n.</li>\r\n<li>X&acirc;y dựng kế hoạch học tập thường xuy&ecirc;n.</li>\r\n<li>Trau dồi kiến thức m&ocirc;n to&aacute;n qua c&aacute;c b&agrave;i kiểm tra.</li>\r\n<li>Học tập c&oacute; kế hoạch.</li>\r\n<li>X&acirc;y dựng mục ti&ecirc;u v&agrave; chinh phục.</li>\r\n<li>Đột ph&aacute; kết quả học tập.</li>\r\n<li>H&igrave;nh th&agrave;nh h&igrave;nh mẫu con người l&iacute; tưởng của x&atilde; hội.</li>\r\n</ol>\r\n<p style=\"text-align: justify;\">Điều đặc biệt duy nhất v&agrave; hay nhất của chương tr&igrave;nh ch&iacute;nh l&agrave; được gi&uacute;p đỡ v&agrave; k&egrave;m cặp huấn luyện từ chuy&ecirc;n gia huấn luyện ph&aacute;t triển c&aacute; nh&acirc;n TMT Coaching.</p>\r\n<p style=\"text-align: justify;\">Bạn cần, thật sự cần một \" chuy&ecirc;n gia huấn luyện, k&egrave;m cặp, v&agrave; đ&aacute; địt bạn tiến l&ecirc;n\".</p>', NULL, 199000, NULL, 2, 1, 11, 1, 5, NULL, NULL, 1, NULL),
(35, 'r', 'r', 'image-default.png', '', '<p>r</p>', NULL, 0, NULL, 0, 2, NULL, NULL, NULL, NULL, NULL, 0, NULL);
