INSERT INTO `introduce_lecturer` (`id`, `image`, `id_lecturer`, `job`, `experience`, `short_introduce`, `detail_introduce`) VALUES
(1, 'UtqOZbuwp9IJBb2KIY-7DYYwAvco3A6ph9Tdj0vYi8RmKdZMAu95_Ho4cgHhE_6u.png', 1, 'Huấn luyện viên', NULL, '<p style=\"text-align: justify;\">Với 4 năm kinh nghiệm đ&agrave;o tạo huấn luyện đột ph&aacute; cho h&agrave;ng ngh&igrave;n học vi&ecirc;n mỗi năm.</p>', '<h3 style=\"text-align: justify;\"><span style=\"color: #000000;\"><strong>TMT Coaching.</strong></span></h3>\r\n<h3 style=\"text-align: justify;\"><span style=\"color: #000000;\">C&ocirc;ng việc ch&iacute;nh l&agrave; điều h&agrave;nh 24H SCHOOL.</span></h3>\r\n<h3 style=\"text-align: justify;\"><span style=\"color: #000000;\">Với kinh nghiệm hơn 4 năm trong nghề diễn thuyết, tr&igrave;nh b&agrave;y v&agrave; huấn luyện. TMT cho ra hệ thống dạy học trực tuyến 24H SCHOOL với những chức năng tiện lợi cung cấp cho c&aacute;c giảng vi&ecirc;n v&agrave; học vi&ecirc;n những trải nghiệm học online hiệu quả v&agrave; dễ d&agrave;ng hơn.</span></h3>\r\n<h3 style=\"text-align: justify;\"><span style=\"color: #000000;\">Đồng thời TMT c&oacute; những chương tr&igrave;nh đ&agrave;o tạo, huấn luyện ph&ugrave; hợp với c&aacute;c c&aacute; nh&acirc;n l&agrave; học sinh, sinh vi&ecirc;n, phụ huynh v&agrave; đặc biệt l&agrave; c&aacute;c giảng vi&ecirc;n kh&aacute;c. Với c&aacute;c lĩnh vực nỗi trội l&agrave; hướng nghiệp, phương ph&aacute;p học tập th&ocirc;ng minh, động lực, kỹ năng mềm, x&acirc;y dựng h&igrave;nh ảnh c&aacute; nh&acirc;n tr&ecirc;n internet, bộ kỹ năng tiếp cập cũng như l&agrave;m bạn với học vi&ecirc;n v&agrave; ngo&agrave;i ra anh cũng l&agrave; giảng vi&ecirc;n dạy bộ m&ocirc;n to&aacute;n học c&aacute;c khối lớp THCS lẫn THPT.</span></h3>'),
(2, 'logo-top5.png', 1, NULL, NULL, NULL, NULL),
(3, 'logo-top5.png', 1, NULL, NULL, NULL, NULL);
